class ShowImage
{
	private $im;
	private $loc;
	private $nam;
	public $notImg; 
	
public function theImage($dr,$nam) {
	$this->notImg = "<img width='13px' src='".$GLOBALS['emoji_sad']."'> &nbsp; Invalid Image <em><font color='#00ff00'>". $nam ."</font></em>. &nbsp; <img width='13px' src='".$GLOBALS['emoji_sad']."'>";
	$this->nam = $nam;
	$this->loc = $dr.'/'.$nam;
	$ext = pathinfo($this->nam, PATHINFO_EXTENSION);
	switch (strtolower($ext)) {
	case "jpg" : 
	if (ImageCreateFromJpeg($this->loc)) {
		Header("Content-type: image/jpeg");
		$this->im = ImageCreateFromJpeg($this->loc);
		$this->theImgCode('jpg');
	} else $GLOBALS['customError'] = $this->notImg;
	break;
	case "gif" :
	if (ImageCreateFromGif($this->loc)) {
		Header("Content-type: image/gif");
		$this->im = ImageCreateFromGif($this->loc);
		$this->theImgCode('gif');
	} else $GLOBALS['customError'] = $this->notImg;
	break;
	case "png" : 
	if (ImageCreateFromPng($this->loc)) {
		Header("Content-type: image/png");
		$this->im = ImageCreateFromPng($this->loc);
		$this->theImgCode('png');
	} else $GLOBALS['customError'] = $this->notImg;
	break;
	default:
	break;
	}
}

private function theImgCode($type) {
	$font = 'phpi';
	if(!$si) $si = 66;
	$tsize = imagettfbbox($si,0,$font,$text);
	$dx = abs($tsize[2]-$tsize[0]);
	$dy = abs($tsize[5]-$tsize[3]);
	$x = ( imagesx($this->im) - $dx ) / 2;
	$y = ( imagesy($this->im) - $dy ) / 2 + 3*$dy/4;
	$blue = ImageColorAllocate($this->im,0x5B,0x69,0xA6);
	$white = ImageColorAllocate($this->im,255,255,255);
	$black = ImageColorAllocate($this->im,0,0,0);
	ImageAlphaBlending($im,true);
	ImageTTFText($this->im, $si, 0, $x, $y, $white, $font, $text);
	ImageTTFText($this->im, $si, 0, $x+2, $y, $white, $font, $text);
	ImageTTFText($this->im, $si, 0, $x, $y+2, $white, $font, $text);
	ImageTTFText($this->im, $si, 0, $x+2, $y+2, $white, $font, $text);
	ImageTTFText($this->im, $si, 0, $x+1, $y+1, $black, $font, $text);
	switch ($type){
		case 'png' :
			ImagePNG($this->im);
		break;
		case 'jpg' :
			ImageJPEG($this->im);
		break;
		case 'gif' :
			ImageGIF($this->im);
		break;
		default:
		break;
	}
}
}
class GenImg extends ShowImage
{
	public $code;
	public $secretX;
	public $image;
	public function keyImg($width = 100, $height = 15, $inSource = false, $code) {
		if ($code === '' || $code === null || empty($code)) {
		$code = substr(md5($_SERVER['REMOTE_ADDR'].microtime().rand(1,100000)),0,6);
		}
		if ($inSource === '' || $inSource === null || empty($inSource)) {
		$inSource = false;
		}
		if(isset($_GET['png2code'])){
		$im = ImageCreate($width,$height);
		$white = ImageColorAllocate($im,255,255,255);
		$black = ImageColorAllocate($im,0,0,0);
		$red = ImageColorAllocate($im,255,0,0);
		$green = ImageColorAllocate($im,0,255,0);
		$blue = ImageColorAllocate($im,0,0,255);
		ImageString($im,3,7,0.5,substr($code,0,1),$black); //1
		ImageString($im,4,18,0.3,substr($code,1,1),$red); //2
		ImageStringUp($im,5,30,10,substr($code,2,1),$black); //3
		ImageString($im,4,50,1.1,substr($code,3,1),$blue); //4
		ImageString($im,3,70,0.6,substr($code,4,1),$black); //5
		ImageStringUp($im,5,79,9,substr($code,5,1),$red); //6
		if (!$inSource) {
		Header('Content-Type: image/png');
		ImagePNG($im);
		} else {
		$this->code = $im;
		return true; }
		}
		$this->secretX = $code;
		return $this->image = ImagePNG($im);
	} 
}



// Convert a string into binary
function str2bin($str) {
$value = unpack('H*', $str);
	 return base_convert($value[1], 16, 2);
}
// Convert binary into a string
function bin2str($bin) {
	return pack('H*', base_convert($bin, 2, 16));
}

